import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AgeInput from './components/AgeInput'; // Import the AgeInput component
import FrontPage from './components/rontPage'; // Import the FrontPage component
import Signup from './components/Signup';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import ForgotPassword from './components/ForgotPassword';

function App() {
  return (
    <Router>
      <Routes>
        {/* Age verification route */}
        <Route path="/" element={<AgeInput />} /> {/* Ask for age first */}

        {/* FrontPage Route */}
        <Route path="/frontpage" element={<FrontPage />} /> {/* Show the front page */}

        {/* User Authentication Routes */}
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
      </Routes>
    </Router>
  );
}

export default App;
